import React from 'react';
import { makeStyles } from '@mui/material';
import { 
  Card, 
  CardContent,
  Typography,
  Divider,
  List, 
  ListItem,
  ListItemText 
} from '@material-ui/core';

const useStyles = makeStyles({
  root: {
    minWidth: 275,
  },
  title: {
    fontSize: 18,
  },
  balance: {
    fontSize: 16,
    fontWeight: 'bold'
  }
});

export default function Checking({account}) {
  const classes = useStyles();

  return (
    <Card className={classes.root}>
      <CardContent>
        <Typography 
          className={classes.title} 
          color="textSecondary" 
          gutterBottom
        >
          Checking Account
        </Typography>
        
        <Typography variant="h5" component="h2">
          {account.name}
        </Typography>
        
        <Typography className={classes.balance}>
          Balance: ${account.balance}
        </Typography>
        
        <Divider />
        
        <List>
          {account.transactions.map(trans => (
            <ListItem key={trans.id}>
              <ListItemText 
                primary={trans.description}
                secondary={`${trans.amount} - ${trans.date}`} 
              />
            </ListItem>
          ))}
        </List>
        
      </CardContent>
    </Card>
  );
}
